[package]
name = "relm4-icons"
authors = ["Aaron Erhardt <aaron.erhardt@t-online.de>"]
version = "0.7.0"
edition = "2021"
rust-version = "1.70"
readme = "README.md"
license = "Apache-2.0 OR MIT"
description = "Icons for Relm4 or any application based on gtk-rs"

homepage = "https://relm4.org"
repository = "https://github.com/Relm4/icons"

keywords = ["gui", "gtk", "gtk4", "elm"]
categories = ["gui"]

[workspace]
members = [
    "update_icons"
]

[dependencies]
gtk = { version = "0.7", package = "gtk4" }

[build-dependencies]
gvdb = { version = "0.6.0", features = ["gresource"] }

[package.metadata.docs.rs]
all-features = true
# enable unstable features in the documentation
rustdoc-args = ["--cfg", "docsrs"]

[features]
default = []

# Enable entire icon kits
icon-development-kit = []
fluent-system-icons = []

